    notes:
      '* <b>Tristana</b> can still use her <a href="/wiki/Champion_ability" title="Champion ability">abilities</a>, <a title="Summoner spell" href="/wiki/Summoner_spell">summoner spells</a>, and <a href="/wiki/Active_ability_items" title="Active ability items">item actives</a> during <i>Rocket Jump</i>.\n<ul><li><i>Rocket Jump\'s</i> dash speed depends on the distance of the jump. Close-ranged jumps are much shorter while long-ranged jumps leave <b>Tristana</b> in the air significantly longer.</li>\n<li>If <b>Tristana</b> has less than 850 movement speed, a full-range <i>Rocket Jump</i> (including its cast time) will make her arrive quicker at its destination than walking at this speed could.</li>\n<li>Killing <span class="glossary" style="white-space:pre; position:relative;" data-game="lol" data-tip="Clone"><a title="Champion summoned units" href="/wiki/Champion_summoned_units#decoys"><img height="20" width="20" data-image-key="Shaco_Command-_Hallucinate.png" src="data:image/gif;base64,R0lGODlhAQABAIABAAAAAP///yH5BAEAAAEALAAAAAABAAEAQAICTAEAOw%3D%3D" data-relevant="0" alt="Command Hallucinate" loading="lazy" data-src="https://static.wikia.nocookie.net/leagueoflegends/images/d/d7/Shaco_Command-_Hallucinate.png/revision/latest/scale-to-width-down/20?cb=20170204131432" decoding="async" class="lazyload" data-image-name="Shaco Command- Hallucinate.png"></a> <a href="/wiki/Champion_summoned_units#decoys" title="Champion summoned units">clones</a></span> or detonating <span data-champion="Tristana" data-ability="Explosive Charge" data-game="lol" class="inline-image label-after ability-icon" style="display:inline;white-space:pre;" data-param=""><span class="border" style="display:inline-block;position:relative;" data-width="20"><a title="Explosive Charge" href="/wiki/Tristana/LoL#Explosive_Charge"><img src="data:image/gif;base64,R0lGODlhAQABAIABAAAAAP///yH5BAEAAAEALAAAAAABAAEAQAICTAEAOw%3D%3D" data-relevant="0" data-image-name="Tristana Explosive Charge.png" width="20" loading="lazy" decoding="async" class="thumbborder lazyload" height="20" data-image-key="Tristana_Explosive_Charge.png" data-src="https://static.wikia.nocookie.net/leagueoflegends/images/e/e6/Tristana_Explosive_Charge.png/revision/latest/scale-to-width-down/20?cb=20170818195216" alt="Explosive Charge"></a></span> <span style="white-space:normal;"><a title="Tristana/LoL" href="/wiki/Tristana/LoL#Explosive_Charge">Explosive Charge</a></span></span> on them also resets <i>Rocket Jump\'s</i> cooldown.\n<ul><li>The former may be unintended.</li></ul></li></ul>',
